import "./App.css";
import { Routes, Route } from "react-router-dom";
import Dashboard from "./Dashboard";

const App = () => {
  return (
    <Routes>
      <Route exact path="/dashboard" component={Dashboard} />
    </Routes>
  );
};
export default App;
